import React from 'react';
import { Layout } from './layout/Layout.js';

function Speaking() {
  return (
    <Layout>
      <div className="text-block-left small">
        <p>
          I've spoken at conferences and things.
        </p>
      </div>
    </Layout>
  );
}

export default Speaking;
